def from_records(cls, data, index=None, exclude=None, columns=None, coerce_float=False, nrows=None):
    """
    Convert structured or record ndarray to DataFrame.

    Parameters
    ----------
    data : ndarray (structured dtype), list of tuples, dict, or DataFrame
    index : string, list of fields, array-like
        Field of array to use as the index, alternately a specific set of
        input labels to use
    exclude : sequence, default None
        Columns or fields to exclude
    columns : sequence, default None
        Column names to use. If the passed data do not have names
        associated with them, this argument provides names for the
        columns. Otherwise this argument indicates the order of the columns
        in the result (any names not found in the data will become all-NA
        columns)
    coerce_float : boolean, default False
        Attempt to convert values of non-string, non-numeric objects (like
        decimal.Decimal) to floating point, useful for SQL result sets
    nrows : int, default None
        Number of rows to read if data is an iterator

    Returns
    -------
    DataFrame
    """
    if columns is not None:
        columns = ensure_index(columns)
    if is_iterator(data):
        if nrows == 0:
            return cls()
        try:
            first_row = next(data)
        except StopIteration:
            return cls(index=index, columns=columns)
        dtype = None
        if hasattr(first_row, 'dtype') and first_row.dtype.names:
            dtype = first_row.dtype
        values = [first_row]
        if nrows is None:
            values += data
        else:
            values.extend(itertools.islice(data, nrows - 1))
        if dtype is not None:
            data = np.array(values, dtype=dtype)
        else:
            data = values
    if isinstance(data, dict):
        if columns is None:
            columns = arr_columns = ensure_index(sorted(data))
            arrays = [data[k] for k in columns]
        else:
            arrays = []
            arr_columns = []
            for (k, v) in data.items():
                if k in columns:
                    arr_columns.append(k)
                    arrays.append(v)
            (arrays, arr_columns) = reorder_arrays(arrays, arr_columns, columns)
    elif isinstance(data, (np.ndarray, DataFrame)):
        (arrays, columns) = to_arrays(data, columns)
        if columns is not None:
            columns = ensure_index(columns)
        arr_columns = columns
    else:
        (arrays, arr_columns) = to_arrays(data, columns, coerce_float=coerce_float)
        arr_columns = ensure_index(arr_columns)
        if columns is not None:
            columns = ensure_index(columns)
        else:
            columns = arr_columns
    if exclude is None:
        exclude = set()
    else:
        exclude = set(exclude)
    result_index = None
    if index is not None:
        if isinstance(index, str) or not hasattr(index, '__iter__'):
            i = columns.get_loc(index)
            exclude.add(index)
            if len(arrays) > 0:
                result_index = Index(arrays[i], name=index)
            else:
                result_index = Index([], name=index)
        else:
            try:
                index_data = [arrays[arr_columns.get_loc(field)] for field in index]
                result_index = ensure_index_from_sequences(index_data, names=index)
                exclude.update(index)
            except Exception:
                result_index = index
    if any(exclude):
        arr_exclude = [x for x in exclude if x in arr_columns]
        to_remove = [arr_columns.get_loc(col) for col in arr_exclude]
        arrays = [v for (i, v) in enumerate(arrays) if i not in to_remove]
        arr_columns = arr_columns.drop(arr_exclude)
        columns = columns.drop(exclude)
    mgr = arrays_to_mgr(arrays, arr_columns, result_index, columns)
    return cls(mgr)

@classmethod
def from_items(cls, items, columns=None, orient='columns'):
    """
    Construct a DataFrame from a list of tuples.

    .. deprecated:: 0.23.0
      `from_items` is deprecated and will be removed in a future version.
      Use :meth:`DataFrame.from_dict(dict(items)) <DataFrame.from_dict>`
      instead.
      :meth:`DataFrame.from_dict(OrderedDict(items)) <DataFrame.from_dict>`
      may be used to preserve the key order.

    Convert (key, value) pairs to DataFrame. The keys will be the axis
    index (usually the columns, but depends on the specified
    orientation). The values should be arrays or Series.

    Parameters
    ----------
    items : sequence of (key, value) pairs
        Values should be arrays or Series.
    columns : sequence of column labels, optional
        Must be passed if orient='index'.
    orient : {'columns', 'index'}, default 'columns'
        The "orientation" of the data. If the keys of the
        input correspond to column labels, pass 'columns'
        (default). Otherwise if the keys correspond to the index,
        pass 'index'.

    Returns
    -------
    DataFrame
    """
    warnings.warn('from_items is deprecated. Please use DataFrame.from_dict(dict(items), ...) instead. DataFrame.from_dict(OrderedDict(items)) may be used to preserve the key order.', FutureWarning, stacklevel=2)
    (keys, values) = zip(*items)
    if orient == 'columns':
        if columns is not None:
            columns = ensure_index(columns)
            idict = dict(items)
            if len(idict) < len(items):
                if not columns.equals(ensure_index(keys)):
                    raise ValueError('With non-unique item names, passed columns must be identical')
                arrays = values
            else:
                arrays = [idict[k] for k in columns if k in idict]
        else:
            columns = ensure_index(keys)
            arrays = values
        try:
            return cls._from_arrays(arrays, columns, None)
        except ValueError:
            if not is_nested_list_like(values):
                raise ValueError('The value in each (key, value) pair must be an array, Series, or dict')
    elif orient == 'index':
        if columns is None:
            raise TypeError("Must pass columns with orient='index'")
        keys = ensure_index(keys)
        try:
            arr = np.array(values, dtype=object).T
            data = [lib.maybe_convert_objects(v) for v in arr]
            return cls._from_arrays(data, columns, keys)
        except TypeError:
            if not is_nested_list_like(values):
                raise ValueError('The value in each (key, value) pair must be an array, Series, or dict')
    else:
        raise ValueError("'orient' must be either 'columns' or 'index'")

