def _unpickle_frame_compat(self, state):
    if len(state) == 2:
        (series, idx) = state
        columns = sorted(series)
    else:
        (series, cols, idx) = state
        columns = com._unpickle_array(cols)
    index = com._unpickle_array(idx)
    self._data = self._init_dict(series, index, columns, None)

def __getitem__(self, key):
    key = lib.item_from_zerodim(key)
    key = com.apply_if_callable(key, self)
    if is_hashable(key):
        if self.columns.is_unique and key in self.columns:
            if self.columns.nlevels > 1:
                return self._getitem_multilevel(key)
            return self._get_item_cache(key)
    indexer = convert_to_index_sliceable(self, key)
    if indexer is not None:
        return self._slice(indexer, axis=0)
    if isinstance(key, DataFrame):
        return self.where(key)
    if com.is_bool_indexer(key):
        return self._getitem_bool_array(key)
    is_single_key = isinstance(key, tuple) or not is_list_like(key)
    if is_single_key:
        if self.columns.nlevels > 1:
            return self._getitem_multilevel(key)
        indexer = self.columns.get_loc(key)
        if is_integer(indexer):
            indexer = [indexer]
    else:
        if is_iterator(key):
            key = list(key)
        indexer = self.loc._get_listlike_indexer(key, axis=1, raise_missing=True)[1]
    if getattr(indexer, 'dtype', None) == bool:
        indexer = np.where(indexer)[0]
    data = self.take(indexer, axis=1)
    if is_single_key:
        if data.shape[1] == 1 and (not isinstance(self.columns, MultiIndex)):
            data = data[key]
    return data

def _getitem_bool_array(self, key):
    if isinstance(key, Series) and (not key.index.equals(self.index)):
        warnings.warn('Boolean Series key will be reindexed to match DataFrame index.', UserWarning, stacklevel=3)
    elif len(key) != len(self.index):
        raise ValueError('Item wrong length %d instead of %d.' % (len(key), len(self.index)))
    key = check_bool_indexer(self.index, key)
    indexer = key.nonzero()[0]
    return self.take(indexer, axis=0)

def _getitem_multilevel(self, key):
    loc = self.columns.get_loc(key)
    if isinstance(loc, (slice, Series, np.ndarray, Index)):
        new_columns = self.columns[loc]
        result_columns = maybe_droplevels(new_columns, key)
        if self._is_mixed_type:
            result = self.reindex(columns=new_columns)
            result.columns = result_columns
        else:
            new_values = self.values[:, loc]
            result = self._constructor(new_values, index=self.index, columns=result_columns)
            result = result.__finalize__(self)
        if len(result.columns) == 1:
            top = result.columns[0]
            if isinstance(top, tuple):
                top = top[0]
            if top == '':
                result = result['']
                if isinstance(result, Series):
                    result = self._constructor_sliced(result, index=self.index, name=key)
        result._set_is_copy(self)
        return result
    else:
        return self._get_item_cache(key)

def _get_value(self, index, col, takeable: bool=False):
    """
    Quickly retrieve single value at passed column and index.

    Parameters
    ----------
    index : row label
    col : column label
    takeable : interpret the index/col as indexers, default False

    Returns
    -------
    scalar
    """
    if takeable:
        series = self._iget_item_cache(col)
        return com.maybe_box_datetimelike(series._values[index])
    series = self._get_item_cache(col)
    engine = self.index._engine
    try:
        return engine.get_value(series._values, index)
    except KeyError:
        if self.index.nlevels > 1:
            raise
    except (TypeError, ValueError):
        pass
    col = self.columns.get_loc(col)
    index = self.index.get_loc(index)
    return self._get_value(index, col, takeable=True)

def __setitem__(self, key, value):
