def _reduce(self, op, name, axis=0, skipna=True, numeric_only=None, filter_type=None, **kwds):
    if axis is None and filter_type == 'bool':
        labels = None
        constructor = None
    else:
        axis = self._get_axis_number(axis)
        labels = self._get_agg_axis(axis)
        constructor = self._constructor

    def f(x):
        return op(x, axis=axis, skipna=skipna, **kwds)
    if axis == 1 and self._is_datelike_mixed_type and (not self._is_homogeneous_type and (not is_datetime64tz_dtype(self.dtypes[0]))):
        numeric_only = True
    if numeric_only is None:
        try:
            values = self.values
            result = f(values)
            if filter_type == 'bool' and is_object_dtype(values) and (axis is None):
                result = np.bool_(result)
        except Exception as e:
            if filter_type is None and axis == 0:
                try:
                    from pandas.core.apply import frame_apply
                    opa = frame_apply(self, func=f, result_type='expand', ignore_failures=True)
                    result = opa.get_result()
                    if result.ndim == self.ndim:
                        result = result.iloc[0]
                    return result
                except Exception:
                    pass
            if filter_type is None or filter_type == 'numeric':
                data = self._get_numeric_data()
            elif filter_type == 'bool':
                data = self._get_bool_data()
            else:
                e = NotImplementedError('Handling exception with filter_type {f} notimplemented.'.format(f=filter_type))
                raise_with_traceback(e)
            with np.errstate(all='ignore'):
                result = f(data.values)
            labels = data._get_agg_axis(axis)
    else:
        if numeric_only:
            if filter_type is None or filter_type == 'numeric':
                data = self._get_numeric_data()
            elif filter_type == 'bool':
                data = self._get_bool_data() if axis == 0 else self
            else:
                msg = 'Generating numeric_only data with filter_type {f}not supported.'.format(f=filter_type)
                raise NotImplementedError(msg)
            values = data.values
            labels = data._get_agg_axis(axis)
        else:
            values = self.values
        result = f(values)
    if hasattr(result, 'dtype') and is_object_dtype(result.dtype):
        try:
            if filter_type is None or filter_type == 'numeric':
                result = result.astype(np.float64)
            elif filter_type == 'bool' and notna(result).all():
                result = result.astype(np.bool_)
        except (ValueError, TypeError):
            if axis == 0:
                result = coerce_to_dtypes(result, self.dtypes)
    if constructor is not None:
        result = Series(result, index=labels)
    return result

def _get_agg_axis(self, axis_num):
    """
    Let's be explicit about this.
    """
    if axis_num == 0:
        return self.columns
    elif axis_num == 1:
        return self.index
    else:
        raise ValueError('Axis must be 0 or 1 (got %r)' % axis_num)

